B.FD=new A.fg("\xbfPor qu\xe9 yo?","SELECTIVO Y SINCERO\nSer el encargado de tu marca requiere compromiso y responsabilidad, es por eso que antes de comenzar analizar\xe9 tu negocio con mucho detalle para concluir si cumples con todos los requerimientos para poder apoyarte.\n\nEn caso de ser un S\xcd pondremos un plan de acci\xf3n eficaz.\n\nEn caso de ser un NO te dar\xe9 mi feedback sincero para referirte con el especialista o plan que tu negocio necesite.\n\nPRECIO SEG\xdaN TU MODELO DE NEGOCIO\nAlgo que me caracteriza es que reviso muy a detalle tu negocio antes de comenzar e incluso evaluando en conjunto contigo puedo saber si est\xe1s preparado para dar este paso.\n\nMi promesa es que cuando adquieras mi servicio sea un gran alivio y veas resultados.\n\nEXPERIENCIA Y RESULTADOS\nDesde la creaci\xf3n de la estrategia, copywriting, anuncios creativos, segmentaci\xf3n, funnels de conversi\xf3n de tu web, manejo de presupuesto y an\xe1lisis de resultados est\xe1n dentro de mis capacidades para ocupar este puesto",null)
B.FB=new A.fg("Preguntas frecuentes","\xbfCu\xe1l es el costo promedio para que seas el encargado de la publicidad de mi negocio?\nEl precio comienza desde los $4000 en adelante, depende de muchos factores y los objetivos que tengas como negocio es por eso que me tomo el tiempo de analizar previamente y saber si puedo asumir el proyecto.\n\n\xbfVer\xe9 resultados de inmediato?\nEsta pregunta es muy com\xfan, y esto depende de como est\xe1 plasmada la estrategia, tu producto, precio y valor percibido por tu audiencia.\n\nLa respuesta correcta es que me encargar\xe9 de que impactes a tu p\xfablico objetivo de una manera inteligente.\n\nUna vez rellene el formulario \xbfQu\xe9 suceder\xe1?\nEn el transcurso de  2 a 3 d\xedas me comunicar\xe9 contigo para darte todos los detalles y tendremos una reuni\xf3n que durar\xe1 30 minutos para entender tus necesidades y n\xfameros al 100%.",null)
B.Ri=A.a(s([B.Fu,B.v,B.Fy,B.v,B.Fw,B.v,B.FD,B.v,B.FB]),t.p)
B.Kb=new A.hs(B.Y,B.j,B.h,B.i,null,B.l,null,B.Ri,null)
B.FA=new A.fg("\xbfPor d\xf3nde comenzar?","Estar solo en el proceso suele ser dif\xedcil e intentar comprender la plataforma, cu\xe1nto presupuesto diario invertir, tener errores, estar inhabilitados, no saber si la estrategia funcionar\xe1 y c\xf3mo analizar los resultados suele ser un dolor de cabeza.\n\nEs por eso que esta asesor\xeda te ayudar\xe1 a obtener un panorama m\xe1s exacto de lo que necesitas y adem\xe1s acelerar el proceso que debes tener como negocio.\n\nCon mi experiencia en el mundo de la publicidad digital, puedo darte una visi\xf3n m\xe1s clara de lo que requieres para aumentar las ventas.\n\nDurante el 2021 comenc\xe9 a realizar estas asesor\xedas y he perfeccionado la metodolog\xeda para que puedas aprovechar este tiempo en aclarar todas tus dudas y solucionar esos errores comunes que hacen que no avances, corregirlos y dar en el punto de posicionar tu negocio.\n\nAl comprar el servicio te llegar\xe1 un correo con la informaci\xf3n que necesitas tener para ese d\xeda y podamos aprovechar la asesor\xeda al m\xe1ximo.",null)
B.FC=new A.fg("\xbfQu\xe9 hablaremos en la reuni\xf3n?","Plan de negocio\nAnalizar\xe9 si tu propuesta te dar\xe1 rentabilidad con los servicios o productos que quieres comercializar por internet.\n\nCampa\xf1as\nCreadas o no creadas revisar\xe9 su estructura y estrategia de manera estrat\xe9gica.\n\nSitio Web\nExaminar\xe9 toda la estructura y te dar\xe9 la v\xeda para que puedas vender m\xe1s por tu web.\n\nM\xe9todo de Ventas\nDependiendo de la metodolog\xeda mejoraremos la manera en la que cierras con tus clientes.",null)
B.Fz=new A.fg("Preguntas frecuentes","\xbfImporta si no conozco nada de Facebook - Instagram o Tik Tok Ads?\nNo, m\xedralo como si fueran clases privadas solo para ti.\n\n\xbfSi conozco y hago campa\xf1as actualmente esto es para mi?\nS\xed, te har\xe9 un examen general de tu negocio y c\xf3mo puedes mejorar en los puntos en que est\xe9s fallando en ads.\n\n\xbfPuedo ver m\xe1s de 1 hora?\nPor supuesto, en caso de requerir m\xe1s clases al final de nuestro meeting podemos coordinar la hora y d\xeda de las siguientes, tendr\xe1s muchas tareas que te enviar\xe9, si eso sucede, prep\xe1rate para este reto.\n\n\xbfD\xf3nde ser\xe1 la video llamada?\nSer\xe1 a trav\xe9s de la plataforma Zoom.\n\n\xbfY si no estoy satisfecho con mi mentor\xeda?\nEn caso de que no sea lo que esperabas, te devolver\xe9 todo tu dinero.\n\n\xbfTuve un inconveniente, puedo reprogramar nuestra reuni\xf3n?\nTienes 24 horas a m\xe1s tardar para poder agendar otro d\xeda y hora, debes notificar en el siguiente correo: hola@jpdirector.net\n\nEn caso de que no lo hagas en ese tiempo perder\xe1s tu inversi\xf3n y pagar\xe1s nuevamente una nueva asesor\xeda.",null)
